html,
body {
    margin: 0;
    font-family: "San Francisco", sans-serif;
    font-weight: 400;
    scroll-behavior: smooth;
    overflow-x: hidden;
    background-color: var(--bg-color);
}

/*
::-webkit-scrollbar {
  width: 0px;  
  background: transparent;  
}
::-webkit-scrollbar-thumb {
