.hiddenclass{
  display: none;
}

#confetti{
  opacity: 0;
  position: fixed;
  left: 0;
  top: 0;
  transition: all 5s;
}

#confetti.opa{
  opacity: 1;
}

.header{
  margin-top: 20px;
  width: 100%;
  opacity: 0;
  display: flex;
  justify-content: space-between;
}

.header.opac{
  opacity: 1;
  transition: all 1s;
  transition-delay: 0.5s;
}


@keyframes confetti-ani {
  0%   { opacity: 0; }
  100% { opacity: 1; }
}

  
    

    strong {
      font-weight: 500; 
    }
    




a {
    text-decoration: none;
    color: black;
}

.page {
    margin-bottom: 0px;
    margin-top: 50px;
    width: 100%;
    position: relative;
    transition: 1s all;
    display: flex;
    flex-direction: column;
    transform: translateY(200px);
    opacity: 0%;
    -webkit-transition: all 0.4s ease;
    transition: all 0.4s ease;
}

.page.move{
    transform: translateY(0px);
    opacity: 100%;

}


.group {
    display: flex;
    flex-direction: column;
    align-items: center;
}

.element {
    position: relative;
    transition: 0.5s all;
}

.hidden {
    display: none;
}

.message-block {
    line-height: 26px;
    position: relative;
    transition: 0.5s all;
    -webkit-transition: 0.5s all;
    -moz-transition: 0.5s all;
    -ms-transition: 0.5s all;
    -o-transition: 0.5s all;
}

.message-block-last {
    margin-bottom: 15px; 
}

.right .message,
.left .message {
    position: relative;
    transition: 1s opacity, all 0.4s;
    -webkit-transition: 1s opacity, all 0.4s;
    -moz-transition: 1s opacity, all 0.4s;
    -ms-transition: 1s opacity, all 0.4s;
    -o-transition: 1s opacity, all 0.4s;
    opacity: 0;
}

@keyframes bubbleleft {
    0% {
        opacity: 0;
        transform: rotate(-45deg) scaleX(-1);
        left: -3.5px;
    }

    100% {
        opacity: 1;
        transform: rotate(0) scaleX(-1);
    }
}

@keyframes bubbleRight {
    0% {
        opacity: 0;
        transform: rotate(45deg) scaleX(1);
        right: -4.5px;
    }

    100% {
        opacity: 1;
        transform: rotate(0) scaleX(1);
    }
}

.left>svg {
    position: absolute;
    left: -15.5px;
    bottom: -1px;
    transform: rotate(-45deg) scaleX(-1);
    animation: bubbleleft 0.6s;
    animation-fill-mode: forwards;
    animation-delay: 0.6s;
    fill: var(--left-svg-fill);
    opacity: 0;
}

.right>svg {
    position: absolute;
    right: -16.5px;
    bottom: -2px;
    transform: rotate(45deg) scaleX(1);
    animation: bubbleRight 0.6s;
    animation-fill-mode: forwards;
    animation-delay: 0.6s;
    fill: #0253e2;
    opacity: 0;
}

.message-block .show {
    opacity: 1;
}

.right[data-emergence=hidden] .message {
    left: 500px;
}

.right[data-emergence=visible] .message {
    left: 0;
    opacity: 1;
}

.left[data-emergence=hidden] .message {
    left: -500px;
}

.left[data-emergence=visible] .message {
    left: 0px;
    opacity: 1;
}

.message-block {
    display: block;
    width: 100%;
    max-width: 675px; 
   /* max-width: 860px; */
    margin-bottom: 10px;
}

.message {
    border-radius: 30px;
    display: inline-block;
    padding: 15px 25px;
    line-height: 34px;
    font-size: 24px;
}

.right .message {
    background-color: #0253e2;
    color: white;
    float: right;
}

.left .message {
    color: var(--left-message-color);
    background-color: var(--left-message-bg-color);
}


.button-group {
    display: flex;
    justify-content: center;
    margin-top: 75px;
    margin-bottom: 75px;
}


.btn {
    margin: 0 10px;
    background-color: transparent;
    padding: 10px 20px;
    border: var(--btn-border);
    transition: 0.3s all;
    font-size: 20px;
    color: var(--btn-text-color);
    border-radius: 50px;
}

.btn:hover {
    background-color: var(--btn-bg-color-hover);
    cursor: pointer;
}

.btn:focus {
    border-color: var(--border-color);
    outline: none;
}






.profile{
    z-index: 2;
    transform: scale(0.5);
    opacity: 0%;
    margin-top: 25%;
    position: relative;
    display: block;
    margin-left: auto; margin-right: auto;
    height: 200px;
    width: 200px;
 		-webkit-transition: all 0.4s ease;
 		transition: all 0.4s ease;
   }

.profile.animate{
    transform: scale(1);
    opacity: 100%;
}

.profile.animate.smaller{
    margin-top: 23px;
    position: relative;
    display: block;
    left: 2%;
    width: 90px;
    height: 90px;
}
   
   #day {
     margin-top: 100px;
     color: var(--day-color);
     font-size: 16px;
     text-align: center;
     font-weight: 400;
     margin-bottom: 170px;
   }
   
   #currentTime {
     font-weight: 300;
   }
   
   #location{
     margin-top: 60px;
     color: var(--location-color);
     font-size: 14px;
     text-align: center;
     font-family: sans-serif;
     font-weight: 300;
   }

  .text-link-colors{
    color: var(--text-link-colors);
   }

   .light-text-link-colors{
    color: var(--text-link-colors);
    opacity: 0.5;
   }

   .showcase{
    /* left: 0 !important; */
    position: relative;
    display: flex;
   }

   .showcase-box{
    display: flex;
    align-self: flex-start;
   }


.box {
  position: relative;
  display: block;
  margin-right: 20px;
  margin-left: 20px;
  opacity: 0;
  transition: all 0.5s;
  transform: translateY(50px);
}

.box.load {
  opacity: 1;
  transform: translateY(0);
}

.box.a{
  transition-delay: 0.5s;;
}

.box.b{
  transition-delay: 1.05s;;
}

.box.c{
  transition-delay: 1.60s;;
}



.box img{
  -webkit-filter: brightness(100%);
  margin-top: 20px;
   cursor: pointer;
   max-width: 230px; /* 250 */
}


.box img:hover {
-webkit-filter: brightness(70%);
-webkit-transition: all 1s ease;
-moz-transition: all 1s ease;
-o-transition: all 1s ease;
-ms-transition: all 1s ease;
transition: all 0.6s ease;
}


   .gallery-h{
     font-size: 21px;
     font-weight: 500;
     color: var(--text-link-colors);
     display: block;
     width: 150px;
     margin-bottom: 0px;
     
   }

   .gallery-h:hover{
      color: #B130FF;
      transition: all 0.35s;
   }

   .gallery-p{
    font-weight: 400;
    color: var(--text-link-colors);
    opacity: 0.5;
    margin-top: 3px;
    display: block;
    font-size: 16px;;
  }
   
.phone-link{
  text-decoration: underline;
  color: #007aff;
}

#pdf{
  text-decoration: underline;
  color: var(--border-color);
  cursor: pointer;
  line-height: 1;
  margin-left: auto;
  transition: all 1s;
}

#pdf::after{
  content: "👉";
  font-size: 16px;
  opacity: 0;
}

#pdf2{
  color: var(--border-color);
  cursor: pointer;
  line-height: 1;
  transition: all 1s;
  position: absolute;
}

#pdf2:hover{
  color: var(--day-color);
  transform: translateX(25px);
}

#pdf:hover{
  color: var(--day-color);
}

#pdf2::before {
  content: "👉";
  font-size: 16px;
  opacity: 0;
  transform: scale(0);
  transition: all 1s;
}

#pdf2:hover::before{
  font-size: 16px;
  opacity: 1;
  transform: scale(1);
}

.skills{/*
  display: flex;
  flex-direction: row;
  align-items: left; */
  left: 0;
  margin: 0;
  width: 100%;
  max-width: 675px; 
  position: relative;
}


.bigger{
  transform: scale(0.5);
  opacity: 0;
  transition: 1s; /* THE DURATION */
}


.f.triggeredCSS3 {opacity: 1; transform: scale(0.85);}
.w.triggeredCSS3 {opacity: 1; transform: scale(0.85);}
.s.triggeredCSS3 { opacity: 1; transform: scale(0.85);}
.h.triggeredCSS3 {opacity: 1; transform: scale(0.85);}
.c.triggeredCSS3 { opacity: 1; transform: scale(0.85);}
.ps.triggeredCSS3 {opacity: 1; transform: scale(0.85);}
.ae.triggeredCSS3 {opacity: 1; transform: scale(0.85);}
.pr.triggeredCSS3 { opacity: 1; transform: scale(0.85);}
.ai.triggeredCSS3 { opacity: 1; transform: scale(0.85);}

.w{
  transition-delay: 0.5s;
}
.s{
  transition-delay: 1s;
}
.h{
  transition-delay: 1.5s;
}

.c{
  transition-delay: 2s;
}

.ps{
  transition-delay: 2.5s;
}

.ae{
  transition-delay: 3s;
}

.pr{
  transition-delay: 3.5s;
}

.ai{
  transition-delay: 4s;
}




 
@keyframes bounce {
  0%, 20%, 50%, 80%, 100% {
    -moz-transform: translateY(0);
    -ms-transform: translateY(0);
    -webkit-transform: translateY(0);
    transform: translateY(0);
  }
  40% {
    -moz-transform: translateY(-30px);
    -ms-transform: translateY(-30px);
    -webkit-transform: translateY(-30px);
    transform: translateY(-30px);
  }
  60% {
    -moz-transform: translateY(-15px);
    -ms-transform: translateY(-15px);
    -webkit-transform: translateY(-15px);
    transform: translateY(-15px);
  }
}
.arrow {
  position: absolute;
  visibility: hidden;
  top: 420px;
  left: 50%;
  margin-left: -24px;
  width: 40px;
  height: 40px;
  font-size: 15px;
  padding: 20px;
  z-index: 99;
  background-size: 20px 15px;
  background-repeat: no-repeat;
  background-position: center;
}

.bounce {
  -moz-animation: bounce 2s infinite;
  -webkit-animation: bounce 2s infinite;
  animation: bounce 2s infinite;
}









   @media only screen and (min-width: 1000px) {
       
     #day {
      font-size: 24px;
       left: 2%;
     }
   
     #location{
      margin-top: 100px;
