}


     
   }   
   
   
   
@media only screen and (min-width: 1440px) {

   .message-block {
      max-width: 860px;
    }
    .skills{
      max-width: 860px;
    }

    .box img{
      margin-top: 25px;
      cursor: pointer;
      max-width: 264px; /* 250 */
    }
}


