/* Dark Mode */


:root {
    --bg-color: white;
    --border-color: #999999;
    --btn-bg-color-hover:  #dddddd;
    --btn-bg-color: transparent;
    --btn-border: 1px solid #dddddd;
    --location-color: black;
    --day-color: #575757;
    --left-message-bg-color: #e5e4e9;
    --left-message-color: black;
    --left-svg-fill: #e5e4e9;
    --btn-text-color: black;
    --text-link-colors: black;
    --opacity-a: 0;
 }


 
[data-theme="dark"] {
    --bg-color: black;
    --border-color: #5e5e5e;
    --btn-bg-color-hover: #202020;
    --btn-border: 1px solid #202020;
    --location-color: white;
    --day-color: rgb(201, 201, 201);
    --left-message-bg-color: #26252a;
    --left-message-color: white;
    --left-svg-fill: #26252a;
    --btn-text-color: white;
    --text-link-colors: white;
    --opacity-a: 1;
}
  
  .theme-switch input {
    display:none;
  }
  
  























/*  סלידר אין סופי  */
       


.wrapper {
  overflow: hidden;
}

.sliding-background {
  /* background: url("/docs/compare.png") repeat-x; */
  display: flex;
  align-items: center;
  margin-left: 7000px;
  width: 6700px;
  animation: slide 145s linear infinite;
  height: 650px;
}

@keyframes slide{
  0%{
    transform: translate3d(0, 0, 0);
  }
  100%{
    transform: translate3d(-6050px, 0, 0);
  }
}

.slide{
  height: 338px;
  margin-right: 300px;
  vertical-align: center;
}

	                      
	                      





@media screen and (max-width: 950px) {

  #day {
    margin-top: 10%;
    margin-bottom: 90px;
  }   

    .message-block {
        width: 88%;
    }
    .gallery-block{
        margin-left: -125px;
    }

    .left{
        margin-left: 35px;
    }

    .right{
        margin-right: 35px;
    }

    .message {
        border-radius: 1.25em;
        font-size: 16px;
        max-width: 270px;
        padding: 0.5em 1em;
        line-height: 20px;
    }

    .right>svg {
        right: -14.5px;
        height: 85%;
    }

    .left>svg {
        left: -14.5px;
        height: 85%;
    }

    .btn {
        padding: 7px 10px;
        font-size: 13px;
    }

    .gallery-block .box{
        max-width: 300px;
        height: 500px;
    } 

    .skills{
        max-width: 270px;
    }

    #pdf2::before { 
      font-size: 12px; 
    }

    #pdf2 { 
      font-size: 12px; 
    }

    #pdf::after { 
      font-size: 12px; 
    }

    #pdf { 
      font-size: 12px; 
    }

    .bigger{
      height: 50px;
      width: 50px;
    }

    .box img{
      max-width: 190px;
    }
}


@media screen and (max-width: 480px) {
    .left{
        margin-left: 50px;
    }

    .right{
        margin-right: 50px;
    }

    .btn {
        padding: 7px 10px;
        font-size: 14px;
    }

    .showcase{ /*
      display: block; */
      width: 690px;
      flex-direction: row-reverse;
      margin-right: 128%;
      overflow-x: scroll !important;
    white-space: nowrap;
    }

    .box.a{
      transition-delay: 0.3s;;
    }
    
    .box.b{
      transition-delay: 0.3s;;
    }
    
    .box.c{
      transition-delay: 0s;;
    }

    .box {
       transform: translateY(0px);
    }

    .sliding-background {
    height: 400px;
    transform: scale(0.85);
    }
}
